import React from 'react';
import { IndexRoute } from 'react-router';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import './App.css';
import Login from './components/Login/Login';



function App() {
  return (
    <div className="App">
      <h1>Welcome to React Router!</h1>
      <Routes>
        <Route path="/login" component={this.Login} />
      </Routes>
    </div>
  );
}

export default App;
